import styled from "styled-components";
import { FiEye } from "react-icons/fi";
import DataStatus from "./DataStatus";

const MainBase = styled.div`
  padding: 2em;
  color: snow;
`;

const Header = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
`;

const Logo = styled.h1`
  display: flex;
  align-items: center;
`;

const Content = styled.div`
  display: flex;
  justify-content: space-between;

  & > div {
    display: flex;
    flex-direction: column;

    border-radius: 6px;
    background: rgba(0, 0, 0, 0.4);
  }
`;

const Persons = styled.div`
  width: 10%;
  margin-right: 2em;
`;

const Trajectories = styled.div`
  width: 90%;
`;

const Main = ({ data = [] }) => {
  return (
    <MainBase>
      <Header>
        <Logo>
          <FiEye style={{ marginRight: "10px" }} />
          <span>Lil Brother</span>
        </Logo>
        <DataStatus data={data} />
      </Header>

      <Content>
        <Persons>
          Persons
          <ul style={{ listStyle: "none" }}>
            {data.map((person) => (
              <li>
                <button>{person.id}</button>
              </li>
            ))}
          </ul>
        </Persons>
        <Trajectories>Trajectories</Trajectories>
      </Content>

      {data.map((item) => (
        <div>{item.id}</div>
      ))}

      {JSON.stringify(data)}
    </MainBase>
  );
};

export default Main;
